import numpy as np
import base64
_float32_dtype = np.dtype('>f4')
import time

def decode_float_list(base64_string):
    buffer = base64.b64decode(base64_string)
    return np.frombuffer(buffer, dtype=_float32_dtype).tolist()

def decode_base64C(base64_string):
    str_arr = base64.b64decode(base64_string).decode("utf-8")
    return np.array(str_arr.split(",")).astype(_float32_dtype).tolist()
               

if __name__ == "__main__":
    
    vector1 = ""

    vector2 = ""
    start = time.time()
    em_vector1 = decode_base64C(vector1)
    print(len(em_vector1))
    end = time.time()
    print("time decode by C: %f" %(end - start))

    start = time.time()
    em_vector2 = decode_float_list(vector2)
    print(len(em_vector2))
    end= time.time()
    print("time decode by py: %f" %(end - start))
        
    